import React from "react";
import { Link } from "react-router-dom";

const playGame = {
  startGame: false,
  authenticate(cb) {
    playGame.startGame = true;
    setTimeout(cb, 100); // fake async
  },
};
function Button() {
  return (
    <div>
      <Link to="/game" className="btn btn-primary">
        Sign up
      </Link>
    </div>
  );
}

export default Button;
